import React, { Component } from 'react';



class Header extends Component {

	render(){
		return(
			<div style={{height:'40px', paddingLeft:'16px', paddingRight:'16px', display:'flex', alignItems:'center', justifyContent:'space-between'}}>
				<div>
					<span>Hi! Sign in or Register</span>
				</div>

				<div>
					<span style={{paddingLeft:'16px', paddingRight:'16px'}}><strong>Daily Deals</strong></span>
					<span style={{paddingLeft:'16px', paddingRight:'16px'}}><strong>Sell</strong></span>
					<span style={{paddingLeft:'16px', paddingRight:'16px'}}><strong>Help & Contact</strong></span>
				</div>

				<div>
					<span>GBP</span>
				</div>

				<div>
					<span>Your Bag 3.99</span>
				</div>
			</div>
		);
	}
}





export default Header;
